const SET_USERS = 'SET_USERS';

let initialState = {
    orderId: [],
    orderName: null,
    userEmail: null,
    orderSum: null,
    createDate: null
}

const orderReducer = (state = initialState, action) => {
    switch (action.type) {
        case SET_USERS :
            return {...state, users: action.users}
        default:
            return state;
    }
}

export default orderReducer;

export const setUsers = (users) => ({type: SET_USERS, users})
